INSERT INTO `tb_b_lang_value` (`id`, `lang_id`, `att_id`, `value`) VALUES
(10, 1, 4, '<div id="scan">\r\n<h2>ลงทะเบียนอย่างไร?</h2>\r\n<ol>\r\n<li>Place the boarding pass barcode under the scanner until a red light appears on the barcode.</li>\r\n<li>Check the boarding pass number is correct and then press "Confirm" once you are satisfied or press "Cancel" to revise.</li>\r\n<li>Select "Print" if you would like to print your ticket, otherwise please wait to receive your ticket.</li>\r\n</ol>\r\n<h2>สแกน Boarding pass.</h2>\r\n</div>'),
(11, 2, 4, '<div id="scan">\r\n<h2>How to register?</h2>\r\n<ol>\r\n<li>Place the boarding pass barcode under the scanner until a red light appears on the barcode.</li>\r\n<li>Check the boarding pass number is correct and then press "Confirm" once you are satisfied or press "Cancel" to revise.</li>\r\n<li>Select "Print" if you would like to print your ticket, otherwise please wait to receive your ticket.</li>\r\n</ol>\r\n<h2>Scan your boarding pass barcode.</h2>\r\n</div>'),
(12, 3, 4, '<div id="scan">\r\n<h2>如何注册?</h2>\r\n<p style="padding-left: 30px;">请把登机牌的条形码放在扫描器下面直到红灯出现在条形码上。检查好登机牌号码是正确 然后按一下&ldquo;确认&rdquo;如果你满意 或者需要修改的话就按一下&ldquo;取消&rdquo;如果你想打印你的登机牌请选择&ldquo;打印&rdquo;然后等待你的票</p>\r\n<h2>扫描你登机牌的条形码</h2>\r\n</div>'),
