(1, '4579620.jpg', NULL, 'Y', 0, NULL, NULL, 'รองอธิบดีกรมสถ.เป็นประธานพิธีเปิดโครงการพัฒนาบุคลากรด้านการศึกษาท้องถิ่นฯ', 'รองอธิบดีกรมสถ.เป็นประธานพิธีเปิดโครงการพัฒนาบุคลากรด้านการศึกษาท้องถิ่นฯ', '<p>รองอธิบดีกรมสถ.เป็นประธานพิธีเปิดโครงการพัฒนาบุคลากรด้านการศึกษาท้องถิ่นฯ xxx</p>', '2014-01-27 14:15:26', ''),
(2, '7278411.jpg', NULL, 'Y', 0, NULL, NULL, 'ประกาศเทศบาลเมืองเขารูปช้าง เรื่อง การจัดจ้างโดยการประมูลด้วยระบบอิเล็กทรอนิกส์', 'ประกาศเทศบาลเมืองเขารูปช้าง เรื่อง การจัดจ้างโดยการประมูลด้วยระบบอิเล็กทรอนิกส์', '<p>ประกาศเทศบาลเมืองเขารูปช้าง เรื่อง การจัดจ้างโดยการประมูลด้วยระบบอิเล็กทรอนิกส์ yyy</p>', '2014-01-27 14:17:10', ''),
(3, '7729125.jpg', NULL, 'Y', 0, NULL, NULL, 'เปิดโครงการ “อุทยานกล้วยเฉลิมพระเกียรติฯนครหาดใหญ่”', 'เปิดโครงการ “อุทยานกล้วยเฉลิมพระเกียรติฯนครหาดใหญ่”', '<p>เปิดโครงการ &ldquo;อุทยานกล้วยเฉลิมพระเกียรติฯนครหาดใหญ่&rdquo; aaa</p>', '2014-01-27 14:17:54', ''),
(4, '7861236.jpg', NULL, 'Y', 0, NULL, NULL, 'ประกาศ รายชื่อผู้ได้รับคัดเลือกเข้ารับการอบรม ตามโครงการพัฒนาศักยภาพครู', 'ประกาศ รายชื่อผู้ได้รับคัดเลือกเข้ารับการอบรม ตามโครงการพัฒนาศักยภาพครู', '<p>ประกาศ รายชื่อผู้ได้รับคัดเลือกเข้ารับการอบรม ตามโครงการพัฒนาศักยภาพครู&nbsp;bbb</p>', '2014-01-27 14:18:44', '');
INSERT INTO `tb_b_news` (`id`, `title_th`, `title_en`, `title_ch`, `image`, `date`, `short_msg_th`, `short_msg_en`, `short_msg_ch`, `detail_th`, `detail_en`, `detail_ch`, `status`, `cd`, `cb`, `md`, `mb`, `type`, `hotspot_id`, `show_date`) VALUES
(39, 'การเทียบโอน', NULL, '', '5777836.JPG', '20/08/2014', '', NULL, '', '<p>การเทียบโอน สำหรับนักศึกษา หลักปริญญาตรี(เทียบโอน)</p>', NULL, '', 'N', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00', '', '', 0, '0000-00-00 00:00:00'),
(40, 'การใช้งานระบบทะเบียน', NULL, '', '6394980.jpg', '24/08/2014', '', NULL, '', '<p>การขอชื่อผู้ใช้ และรหัสผ่าน สำหรับการใช้งานระบบทะเบียน</p>', NULL, '', 'N', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00', '', '', 0, '0000-00-00 00:00:00'),
(41, 'การติดต่อสำนักงานสาขา', NULL, '', '7419157.jpg', '18/08/2014', '', NULL, '', '<p>รายละเอียดการติดต่อสาขา ของ นักศึกษาสาขาเทคโนโลยีสารสนเทศธุรกิจ</p>', NULL, '', 'Y', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00', '', '', 0, '0000-00-00 00:00:00'),
(45, 'test', NULL, '', '9580198.jpg', '26/08/2014', '', NULL, '', '<p>tests</p>', NULL, '', 'N', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00', '', '', 0, '0000-00-00 00:00:00'),
(46, 'กิจกรรมสานสัมพันธ์น้องพี่', NULL, '', '2326900.jpg', '28/08/2014', '', NULL, '', '<p style="text-align: center;"><strong>"กิจกรรมสานสัมพันธ์น้องพี่"</strong></p>\r\n<p style="text-align: center;"><strong>คณะบริหารธุรกิจและเทคโนโลยีสารสนเทศ ศูนย์นนทบุรี</strong></p>\r\n<p style="text-align: center;"><strong>วันพุธที่ 3 กันยายน 2557</strong></p>\r\n<p style="text-align: center;"><strong>เวลา 07.30-18.45 น.</strong></p>\r\n<p style="text-align: center;"><strong>ณ มทร.สุวรรณภูมิ ศูนย์นนทบุรี (เขตเหนือ)</strong></p>\r\n<p style="text-align: center;">&nbsp;</p>', NULL, '', 'N', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00', '', '', 0, '0000-00-00 00:00:00'),
(44, 'การขอรับ User เพื่อเข้าใช้ระบบ Internet', NULL, '', '2966902.jpg', '27/08/2014', '', NULL, '', '<p>ประกาศ นักศึกษาใหม่ ปี 2557 สามารถติดต่อขอรับ&nbsp;User เพื่อเข้าใช้ระบบ Internet&nbsp;</p>\r\n<p>ติดต่อ : เค้าเตอร์ ยืม-คืน ชั้น 1 อาคาร 19 สำนักวิทยบริการและเทคโนโลยีสารสนเทศ เขตเหนือ</p>\r\n<p>รอบการอบรม</p>\r\n<p>รอบที่ 1 เวลา 9.00 - 10.30 &nbsp;น.</p>\r\n<p>รอบที่ 2&nbsp;เวลา 10.30 - 12.00 น.</p>\r\n<p>รอบที่ 3 เวลา 13.00 - 14.30 น.</p>\r\n<p>รอบที่ 4 เวลา 14.30 - 16.00 น.</p>\r\n<p>รอบที่ 5 เวลา 16.00 - 17.30 น.</p>\r\n<p>(ทุกวันจันทร์ - ศุกร์ ตั้งแต่บัดนี้ ถึง วันที่ 28 สิงหาคม 2557 เท่านั้น)</p>\r\n<p>***หมายเหตุ นักศึกษาต้องผ่านการอบรมการใช้งานห้องสมุดก่อน จึงจะได้รับรหัสเข้าใช้อินเทอร์เน็ต นักศึกษาใหม่ต้องใช้ USER เพื่อเข้าระบบสารสนเทศภายในมหาวิทยาลัย (ต้องใช้ USER เพื่อเข้าระบบทะเบียนในการลงทะเบียนเรียน)</p>\r\n<p>&nbsp;</p>', NULL, '', 'N', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00', '', '', 0, '0000-00-00 00:00:00'),
(47, 'แจ้งนักศึกษาสาขาสารสนเทศการของใช้ห้องคอมพิวเตอร์ธุรกิจ', NULL, '', '7916627.jpg', '28/08/2014', '', NULL, '', '<p style="text-align: center;">แจ้งนักศึกษา</p>\r\n<p style="text-align: center;">สาขาวิชาระบบสารสนเทศและคอมพิวเตอร์ธุรกิจ</p>\r\n<p style="text-align: center;">นักศึกษาที่ต้องการใช้ห้องปฏิบัติการคอมพิวเตอร์นอกเวลาเรียน</p>\r\n<p style="text-align: center;">ให้มาติดต่อขออนุญาตเข้าใช้ห้องได้ที่ห้องสำนักงานชั้น 6</p>', NULL, '', 'Y', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00', '', '', 0, '0000-00-00 00:00:00'),
(48, 'ขอแสดงความยินดีกับผลการเรียนสูงสุด', NULL, '', '7673477.jpg', '17/09/2014', '', NULL, '', '<p>ขอแสดงความยินดี</p>\r\n<p>นางสาวภัสราภรณ์ &nbsp;คำนวนฤทธิ์</p>\r\n<p>ที่ได้รับรางวัลผู้มีผลการเรียนเฉลี่ยสะสมสูงสุด 3.70</p>\r\n<p>สาขาเทคโนโลยีสารสนเทศธุรกิจ</p>', NULL, '', 'N', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00', '', '', 0, '0000-00-00 00:00:00'),
(49, 'แสดงความยินดีนักศึกษาได้ผลการเรียนดี', NULL, '', '6957022.jpg', '18/09/2014', '', NULL, '', '', NULL, '', 'Y', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00', '', '', 0, '0000-00-00 00:00:00'),
(50, 'เสื้อ AEC', NULL, '', '3303734.jpf', '30/09/2014', '', NULL, '', '<p>เสื้อ AEC</p>', NULL, '', 'N', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00', '', '', 0, '0000-00-00 00:00:00'),
