(52, 'เสื้อ AEC', NULL, '', '2106154.jpg', '30/09/2014', '', NULL, '', '<p>เสื้อ AEC</p>', NULL, '', 'Y', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00', '', '', 0, '0000-00-00 00:00:00'),
